import Hero from "../components/hero";
import Navmenuitems from "../components/nav-menu";
import aimg from "../assests/about.jpg"

const About=()=>{
  return <>
      <Navmenuitems/>
      <Hero clsName="hero"
            aimg={aimg} 
            text="Choose Your Favourite Destination" 
            title="Your Story Your Journey"
            btnurl="/"
            btname="btnc"/>
  </>
}
export default About;
